// InternshipPage.js
import React, { useState } from 'react';
import InternshipForm from './InternshipForm';
import './InternshipPage.css';

const InternshipPage = ({ businesses }) => {
  const handleRegistration = (registrationData) => {
    // Handle the registration data, e.g., send it to a server
    console.log('Registration data:', registrationData);
  };

  return (
    <div className="internship-page">
      <h1>Trang Đăng ký Thực tập</h1>
      <div className="internship-list">
        {/* Display a list of internships if needed */}
      </div>
      <div className="internship-form-container">
        <InternshipForm businesses={businesses} onRegister={handleRegistration} />
      </div>
    </div>
  );
};

export default InternshipPage;
